(3,	'Formula Pasta Gigi',	'2017-03-06',	'Formula mau dibuatkan strategy socmed secara content, proposal Lead ini sedang dirapihkan oleh Ejja sesuai diskusi akhir dengan Mba Trinzi.',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	101,	0,	0,	101,	'1',	114,	0,	'2017-03-01 07:57:26',	'2017-03-01 07:57:26'),
(4,	'SILOAM Digital',	'2017-03-09',	'Proposal untuk pembuatan konsep digital (web dan social media), analisa, rekomendasi digital campaign Siloam Hospitals',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	114,	0,	0,	114,	'1',	109,	0,	'2017-03-02 11:09:40',	'2017-03-02 11:09:40'),
(5,	'PROPOSAL PITCHING MARINA',	'2017-03-08',	'Dear team,\r\n\r\naku mau minta tolong untuk dibuatkan proposal untuk kebutuhan pitching marina.\r\nproduct yang ingin mereka highlight adalah: Marina Face care & marina makeup.\r\ndimana, target audiencenya mereka yakni:\r\nusia: 15 - 25 tahun\r\nSES: B, C1\r\nyoung, active, sociable, self aware.\r\nmereka ingin memperlihatkan bahwa marina adalah product yang good quality, cool brand, dan up to date serta modern.\r\nchallengenya untuk di tahun 2017 ini tentu saja meningkatkan engagementnya, lalu digital assetnya growth, selain itu apa saja yang menjadi hype di kalangan millenials.\r\nsehingga, mereka menginginkan:\r\n- 15 artikel / month (artikel ini akan di placement di websitenya mereka, bisa jadi untuk socmed nya juga) (include 1 article infografis per bulan)\r\n- product review KOL 6 pax / year\r\n- photo shoot 1 sesion / month\r\n- video productiion 2 pax / year (video tutorial menggunakan product marina)\r\nDurasi: 8 bulan (Mei - Desember 2017)\r\n\r\nmereka ingin artikel yang atractive dan creative, ketika meeting tadi mereka memberikan contoh artikel dari cewekbanget.id.\r\ndan proposal yag di submit nanti selain sudah dengan offeringnya, mereka ingin ada contoh artikelnya yang original di buat untuk marina. buka rewrite.\r\nso untuk lebih detailnya terlampir dalam proposal ya..\r\njika ada yang ingin ditanyakan dapat menghubungiku langsung\r\nterimakasih :)',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	114,	0,	0,	114,	'1',	108,	0,	'2017-03-03 12:27:50',	'2017-03-03 12:27:50'),
(6,	'Proposal Lead WONG COCO',	'2017-03-09',	'Agenda meeting: untuk mengenalkan service grid kepada wong coco\r\nbeberapa analisa digital wong coco bisa diambil dari inaco yang sudah dibuatkan minggu ini :)',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	99,	0,	0,	99,	'1',	110,	0,	'2017-03-03 12:42:41',	'2017-03-03 12:42:41'),
