(16,	'Proposal content supply utk tema festive utk My Tea dan Mount Tea',	'2017-03-23',	'Mohon dibuatkan proposal paket content supply khusus untuk pembuatan konten konten yang bertema festive lebaran yang akan datang. lengkap dengan analisa2 seperti tipe konten yang biasa dicari di bulan festive. terima kasih :)',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	98,	0,	0,	98,	'1',	106,	0,	'2017-03-16 04:26:49',	'2017-03-16 04:26:49'),
(17,	'So Good Food',	'2017-03-17',	'berdasarkan sharing konten marketing untuk so good. tim so good ingin dibuatkan proposal konten supply yang audience nya adalah anak anak berumur 5-12 tahun  tapi lebih mengarah ke umur (5-8 tahun). tim so good tertarik untuk ditawarkan kerja sama yang bisa menggarap audiens anak anak dan menawarkan konten konten yang relevan untuk anak 5-8 tahun di jaman sekarang. Ingin diberikan dalam waktu dekat \r\n\r\nbeberapa materi yang mereka request untuk di berikan di minggu ini\r\n1. quotation/range harga untuk website management + social media management + konten (10 konten per bulan,  every 2 minggu)\r\n2. portfolio untuk konten / cerita anak anak',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	100,	0,	0,	100,	'1',	110,	0,	'2017-03-16 05:10:41',	'2017-03-16 05:10:41'),
(18,	'Heinz ABC',	'2017-03-25',	'Mohon dibuatkan proposal content supply khusus untuk pembuatan content-content yang bertema festive lebaran yang akan datang. Lengkap dengan analisa analisa seperti tipe konten yang di cari di bulan festive, komparasi dengan konten kompetitor Heinz Abc. \r\n\r\nuntuk produk yang disasar adalah Kecap ABC, dengan pembuatan konten untuk bulan ramadhan. \r\n\r\nterima kasih',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	98,	0,	0,	98,	'1',	110,	0,	'2017-03-16 07:05:20',	'2017-03-16 07:05:20'),
(19,	'VIDEO CETAPHIL',	'2017-03-17',	'Dear all,\r\n\r\naku mau minta tolong dibuatkan proposl untukpembuatan video cetaphil.\r\nbig idea mereka di tahun 2017 adalah: \"Kulit sehat sejati\"\r\nfokusnya: Real healthy clean skin product\r\nide visual: kulit kering berasa seperti kertas\r\nkonsep videonya: cara mengaplikasikan cetaphil dengan metode \"teacher-learner\" di videonya antara talent (brand ambassador) dengan cetaphil expert.\r\nflow videonya dan detailnya terlampir dalam bief dari klien berikut ini ya.',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	114,	0,	0,	114,	'1',	108,	0,	'2017-03-16 08:47:27',	'2017-03-16 08:47:27'),
(20,	'FLAIR MAGAZINE - JOHNNY ANDREAN',	'2017-03-24',	'Dear team,\r\n\r\naku mau minta tolong niiihh untuk dibuatkan proposal external magazine, detailnya sebagai berikut:\r\nNama majalah: FLAIR \r\nDitujukan: external magazine. Ini majalah yang suka ada di salon-salonnya Johnny andrean\r\nTerbit: 2 bulanan (yang sekarang untuk edisi april-mei 2017)\r\nDurasi: sampai bulan desember berarti akan ada 5 edisi\r\nOplah: 25.000 eksemplar\r\nHalaman: 44 halaman\r\n\r\nNah, aku minta dibuatkan 2 alternatif proposal..\r\nAlternatif 1:\r\nKita hanya supply contennya saja. kalau bisa ada photo shoot untuk jadi photo stock, lebih bagus  (budget dari klien 40 juta per edisi)\r\nAlternative 2:\r\nAll in services. Mulai dari content, cetak, dan distribusi ke 1 titik HO \r\n\r\nUntuk jenis kertas, cover, ukuran, dll di suggest oleh kita saja.\r\nContoh majalahnya akan dikirimkan oleh klien untuk bayangan kita nanti.\r\nSo, mohon ditunggu ya majalah asliya..\r\nAku butuh rough timeline nya juga.. kira â€“ kira pembuatan 1 majalah akan menghabiskan waktu berapa lama.\r\nSehingga klien akan berikan feedback secepatnya.\r\n\r\njika ada yang ingin ditanyakan, kindly to contact me\r\nthakyoouuu',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	114,	0,	0,	114,	'1',	108,	0,	'2017-03-17 09:54:30',	'2017-03-17 09:54:30'),
(21,	'Proposal Sales',	'2017-03-31',	'Mohon bantuannya untuk pembuatan proposal content pillar, Pristine mineral water.\r\nKlien ingin dibuatkan ide konten untuk web dan sosmed mereka, lengkap dengan SEO dan engagement strategy. Dengan core audiens female 25-40 dan secondary audiens 25-40 male & female.  Terlampir file brief dari klien. Terima kasih banyak',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	98,	0,	0,	98,	'1',	115,	0,	'2017-03-17 12:00:52',	'2017-03-17 12:00:52'),
