(24,	'OCBC NISP NATIONAL SAVING PROGRAM 2017',	'2017-04-03',	'Dear Team,\r\naku mau minta tolong dibuatkan proposal untuk OCBC. seperti yang sudah kita meetingkan kemarin, bahwa NISP ini punya program national saving program. mereka ingin membuat gimmick2 menarik untuk NTB ataupun yang sudah existing. gimmicknya ini games di websitenya mereka www.tandafuntastrip.com. misal: reedem point, lelang point, atau games2 seru lainnya. selain itu juga mereka ingin membuat activationnya di branch mereka. misal: ada games wheel of fortune atau yang lainnya (silahkan di suggest). untuk lebih detailnya,terlampir dalam proposal yaa',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	114,	0,	0,	114,	'1',	108,	0,	'2017-03-24 09:08:48',	'2017-03-24 09:08:48'),
(25,	'Proposal Kementrian luar Negeri Asean ',	'2017-04-11',	'Kementrian Luar negeri direktorat Asean ingin membuat buku Asean Selayang Pandang\r\nBuku tersebut didistribusikan di pusat studi Asean dan seminar-seminar seluruh indonesia\r\nObjective : Buku tersebut untuk kalangan mahasiswa, akademisi, praktisi, dosen ataupun pengusaha untuk men sosialisasikan atau memperkenalkan Asean lebih dalam.\r\noplah cetak 1.000- 2.000 eksemplar',	'',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	2,	0,	98,	0,	0,	98,	'1',	107,	0,	'2017-04-05 02:47:24',	'2017-04-05 02:47:24'),
